text:
Tantas exigencias burocraticas para implantar protocolos anti covit y se olvidan que los negocios obligados no tienen un puto centavo luego de mas de 100 dias cerrados.
SPR @MartinVizcarraC ojo con ese detalle.
@PeruAmpe @ANGRPERU @Minsa_Peru @RPPNoticias

Revisando los registros de las causales de muerte por medio del SINADEF, hay una diversidad de terminos que le dan al CoVid-19: COVD COID CODVID CIVID OVID CPVID COBIV CVID CORANOVIRUS sars32.
Esto denota URGENTE un sistema de registros con lista desplegables.
